import React from "react";
import Header from "../components/header/header";

export default class ProfileEdit extends React.Component {
    render() {
        return (
            <div>
                <Header />
                <div>
                    <form>
                        <input type="file" accept="image/*" />
                        <a href="/adas/asd"> remove dp</a>
                        <legend>Name<input type="text" placeholder="enter new name" /></legend>
                        <legend>Username
                            <input type="text" placeholder="enter new username" /></legend>
                        <legend>Bio <textarea></textarea></legend>
                        <legend>Gender
                            <select>
                                <option>Male</option>
                                <option>Female</option>
                            </select>
                        </legend>
                    </form>
                </div>
            </div>
        );
    }
}
